import React from "react";

function Portfolio() {
    return (
        <section id="project-section">
            <h2>Section is under development.</h2>
            <div className="projects">
                <div className="personal-portfolio-1">
                    <h4>Personal WebSite</h4>
                    <img id="personal-web-img" src="./images/Screenshot 2022-04-27 174236.png" alt="" />
                    <br />
                    <button type="button" class="btn btn-light"><a className="personal-website" href="https://github.com/KomilJuraev/personal-web-app"><i class="fab fa-fw fa-2xl fa-github"></i>github rep</a></button>
                    <br />
                    <a className="navigate-to-project" href="#header">Navigate to Project</a>
                </div>
                <div className="personal-portfolio-2"></div>
            </div>
        </section >
    )
}

export default Portfolio;
